toolFormerData.rawArgs:
{"command": "# Check file sizes and plan for GitHub
$backupDir = "$env:USERPROFILE\Downloads\CursorVscdbBackup"

Write-Host "=== FILE SIZE ANALYSIS ===" -ForegroundColor Cyan
$files = Get-ChildItem $backupDir -File | Sort-Object Length -Descending

$under100MB = $files | Where-Object { $_.Length -lt 100MB }
$over100MB = $files | Where-Object { $_.Length -ge 100MB }

Write-Host "Files under 100 MB: $($under100MB.Count)"
Write-Host "Files over 100 MB (need LFS): $($over100MB.Count)"
Write-Host ""

Write-Host "=== LARGE FILES (over 100 MB) ===" -ForegroundColor Yellow
$over100MB | ForEach-Object {
    Write-Host "  $($_.Name.Substring(0, [Math]::Min(80, $_.Name.Length)))... - $([math]::Round($_.Length/1MB, 2)) MB"
}

Write-Host ""
Write-Host "=== CHECKING GH CLI AUTH ===" -ForegroundColor Cyan
gh auth status 2>&1

Write-Host ""
Write-Host "=== CHECKING GIT LFS ===" -ForegroundColor Cyan
$lfs = Get-Command git-lfs -ErrorAction SilentlyContinue
if ($lfs) {
    Write-Host "Git LFS installed: $($lfs.Source)" -ForegroundColor Green
} else {
    Write-Host "Git LFS not found - checking if available via git..." -ForegroundColor Yellow
    git lfs version 2>&1
}", "is_background": false, "explanation": "Analyze file sizes and check Git LFS availability"}

