toolFormerData.rawArgs:
{"command": "# Scan worktree session exports
Write-Host "=== SCANNING WORKTREE SESSION EXPORTS ==="

$worktreeDbs = Get-ChildItem -Path "$env:USERPROFILE\.cursor\worktrees" -Filter "state.vscdb" -Recurse -ErrorAction SilentlyContinue
$worktreeDbs += Get-ChildItem -Path "$env:USERPROFILE\DevProjects\worktrees" -Filter "state.vscdb" -Recurse -ErrorAction SilentlyContinue
$worktreeDbs += Get-ChildItem -Path "$env:USERPROFILE\DevProjects\.cursor" -Filter "state.vscdb" -Recurse -ErrorAction SilentlyContinue

$worktreeIds = @()

foreach ($db in $worktreeDbs) {
    try {
        $bytes = [System.IO.File]::ReadAllBytes($db.FullName)
        $content = [System.Text.Encoding]::UTF8.GetString($bytes)
        $matches = [regex]::Matches($content, 'Request\s*ID[:\s]+([a-f0-9]{8}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{12})', 'IgnoreCase')

        if ($matches.Count -gt 0) {
            $shortPath = $db.FullName -replace [regex]::Escape("$env:USERPROFILE\"), ''
            Write-Host "$shortPath : $($matches.Count) Request IDs"
            foreach ($m in $matches) {
                $worktreeIds += $m.Groups[1].Value
            }
        }
    }
    catch {}
}

Write-Host ""
Write-Host "TOTAL from worktrees: $($worktreeIds.Count)"
$uniqueWorktree = $worktreeIds | Sort-Object -Unique
Write-Host "UNIQUE Request IDs: $($uniqueWorktree.Count)"", "is_background": false, "explanation": "Scan worktree session exports for Request IDs"}

