{"command": "# Scan backup copies of databases that are not in use
Write-Host "=== SCANNING BACKUP DATABASES FOR REQUEST IDs ==="
Write-Host ""

$backupDbs = @(
    "C:\Users\user\Desktop\CursorBackup-20251124-225424\AppData\globalStorage\state.vscdb",
    "C:\Users\user\Desktop\CursorBackup-20251124-225424\AppData\workspaceStorage\1808131436ee16580be86f7ed1b3b654\state.vscdb",
    "C:\Users\user\Desktop\CursorBackup-20251124-225424\AppData\workspaceStorage\f7d46c6868271830083a027891fdb029\state.vscdb",
    "C:\Users\user\Desktop\CursorSettingsRepo\AppData\globalStorage\state.vscdb"
)

$allNewIds = @()

foreach ($db in $backupDbs) {
    if (Test-Path $db) {
        try {
            $bytes = [System.IO.File]::ReadAllBytes($db)
            $content = [System.Text.Encoding]::UTF8.GetString($bytes)
            $matches = [regex]::Matches($content, 'Request\s*ID[:\s]+([a-f0-9]{8}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{12})', 'IgnoreCase')

            $shortPath = $db -replace [regex]::Escape("$env:USERPROFILE\"), ''
            Write-Host "$shortPath"
            Write-Host "  Size: $([math]::Round((Get-Item $db).Length/1MB, 2)) MB"
            Write-Host "  Request IDs found: $($matches.Count)"

            foreach ($m in $matches) {
                $allNewIds += $m.Groups[1].Value
            }
        }
        catch {
            Write-Host "  Error reading: $_"
        }
        Write-Host ""
    }
}", "is_background": false, "explanation": "Scan backup databases for Request IDs"}

