{"command": "# Check available tools
Write-Host "=== CHECKING AVAILABLE TOOLS ===" -ForegroundColor Cyan
Write-Host ""

# Check gh CLI
Write-Host "GitHub CLI (gh):"
try { 
    $ghVersion = gh --version 2>&1 | Select-Object -First 1
    Write-Host "  Installed: $ghVersion" -ForegroundColor Green
    $ghAuth = gh auth status 2>&1
    Write-Host "  Auth status:" -NoNewline
    if ($LASTEXITCODE -eq 0) {
        Write-Host " Authenticated" -ForegroundColor Green
    } else {
        Write-Host " Not authenticated" -ForegroundColor Yellow
    }
} catch { Write-Host "  NOT INSTALLED" -ForegroundColor Red }

Write-Host ""

# Check SVN
Write-Host "Subversion (svn):"
try {
    $svnVersion = svn --version --quiet 2>&1
    if ($LASTEXITCODE -eq 0) {
        Write-Host "  Installed: $svnVersion" -ForegroundColor Green
    } else {
        Write-Host "  NOT INSTALLED" -ForegroundColor Red
    }
} catch { Write-Host "  NOT INSTALLED" -ForegroundColor Red }

Write-Host ""

# Check for Google Drive
Write-Host "Google Drive:"
$gdrivePaths = @(
    "$env:USERPROFILE\Google Drive",
    "$env:USERPROFILE\My Drive",
    "G:\My Drive",
    "G:\",
    "$env:USERPROFILE\GoogleDrive"
)
$foundGDrive = $null
foreach ($path in $gdrivePaths) {
    if (Test-Path $path) {
        Write-Host "  Found: $path" -ForegroundColor Green
        $foundGDrive = $path
        break
    }
}
if (-not $foundGDrive) {
    # Check for Google Drive mount points
    Get-PSDrive -PSProvider FileSystem | Where-Object { $_.Description -like "*Google*" } | ForEach-Object {
        Write-Host "  Found Drive: $($_.Root) - $($_.Description)" -ForegroundColor Green
        $foundGDrive = $_.Root
    }
}
if (-not $foundGDrive) {
    Write-Host "  Not found in common locations" -ForegroundColor Yellow
}

Write-Host ""

# Check git
Write-Host "Git:"
try {
    $gitVersion = git --version 2>&1
    Write-Host "  Installed: $gitVersion" -ForegroundColor Green
} catch { Write-Host "  NOT INSTALLED" -ForegroundColor Red }", "is_background": false, "explanation": "Check for gh CLI, svn, git, and Google Drive availability"}

