Write-Host "=== CHECKING VSCDB FILES FOR LOCKS ==="
Write-Host ""

$allVscdb = Get-ChildItem -Path "$env:USERPROFILE" -Filter "*.vscdb" -Recurse -ErrorAction SilentlyContinue -Force

$unlocked = @()
$locked = @()

foreach ($file in $allVscdb) {
    try {
        $stream = [System.IO.File]::Open($file.FullName, 'Open', 'Read', 'None')
        $stream.Close()
        $unlocked += $file
    }
