Write-Host "=== ANALYZING CHAT SESSION DATA ===" -ForegroundColor Cyan
Write-Host ""

# The current locked workspace is 1767070688248
# We need to find if there are backups of this workspace or if chat history is elsewhere

# Check which workspaces have chat data
