    $folder = Split-Path (Split-Path $_.FullName -Parent) -Leaf
    $locked = $false
    try { 
        $s = [System.IO.File]::Open($_.FullName, 'Open', 'Read', 'None')
        $s.Close()
    } catch { $locked = $true }
    $status = if ($locked) { "(LOCKED)" } else { "" }
    Write-Host "  $folder $status - $([math]::Round($_.Length/1MB, 2)) MB"
}

Write-Host ""
