    $folder = Split-Path (Split-Path $_.FullName -Parent) -Leaf
    Write-Host "  $folder - $([math]::Round($_.Length/1MB, 2)) MB"
}

Write-Host ""
Write-Host "=== CHECKING composer.composerData IN BACKUPS ===" -ForegroundColor Cyan

$backups = @(
    "C:\Users\user\Desktop\CursorSettingsRepo\AppData\workspaceStorage\1808131436ee16580be86f7ed1b3b654\state.vscdb",
    "C:\Users\user\Desktop\CursorSettingsRepo\AppData\workspaceStorage\f7d46c6868271830083a027891fdb029\state.vscdb"
)

foreach ($db in $backups) {
    if (Test-Path $db) {
        $folder = Split-Path (Split-Path $db -Parent) -Leaf
        $composerSize = sqlite3 $db "SELECT length(value) FROM ItemTable WHERE key = 'composer.composerData';" 2>$null
        Write-Host "  $folder : composer.composerData = $composerSize bytes"
    }
}", "is_background": false, "explanation": "Compare current session with backups"}

