{"command": "# Check for Google Drive more thoroughly
Write-Host "=== SEARCHING FOR GOOGLE DRIVE ===" -ForegroundColor Cyan

# Check registry for Google Drive installation
$gdReg = Get-ItemProperty "HKCU:\Software\Google\DriveFS" -ErrorAction SilentlyContinue
if ($gdReg) {
    Write-Host "Google Drive for Desktop found in registry" -ForegroundColor Green
    $gdReg | Format-List
}

# Check for virtual drives
Write-Host ""
Write-Host "=== CHECKING MOUNTED DRIVES ===" -ForegroundColor Yellow
Get-PSDrive -PSProvider FileSystem | ForEach-Object {
    $root = $_.Root
    $testPath = Join-Path $root "My Drive"
    if (Test-Path $testPath) {
        Write-Host "Found Google Drive at: $testPath" -ForegroundColor Green
    }
    # Also check root for Google Drive folders
    $gdFolder = Join-Path $root "GoogleDrive"
    if (Test-Path $gdFolder) {
        Write-Host "Found GoogleDrive at: $gdFolder" -ForegroundColor Green
    }
}

# Check environment variables
Write-Host ""
Write-Host "=== ENVIRONMENT VARIABLES ===" -ForegroundColor Yellow
Get-ChildItem env: | Where-Object { $_.Value -like "*google*" -or $_.Value -like "*drive*" } | Format-Table Name, Value -AutoSize

# Check for common installation paths
Write-Host ""
Write-Host "=== GOOGLE DRIVE INSTALLATION ===" -ForegroundColor Yellow
$gdPaths = @(
    "$env:LOCALAPPDATA\Google\DriveFS",
    "$env:PROGRAMFILES\Google\Drive File Stream",
    "G:\My Drive",
    "H:\My Drive"
)

foreach ($p in $gdPaths) {
    if (Test-Path $p) {
        Write-Host "Found: $p" -ForegroundColor Green
    }
}", "is_background": false, "explanation": "Search for Google Drive installation"}

