{"command": "# Extract and merge all composer data from all workspace databases
$stagingDir = "$env:USERPROFILE\Downloads\CursorChatRestore"
New-Item -Path $stagingDir -ItemType Directory -Force | Out-Null

Write-Host "=== EXTRACTING ALL COMPOSER DATA ===" -ForegroundColor Cyan
Write-Host "Staging directory: $stagingDir"
Write-Host ""

$allVscdb = Get-ChildItem -Path "$env:USERPROFILE" -Filter "*.vscdb" -Recurse -ErrorAction SilentlyContinue -Force |
    Where-Object { $_.FullName -notlike "*Roaming\Cursor\User\globalStorage\state.vscdb" -and 
                   $_.FullName -notlike "*1767070688248*" }

$allComposers = @()
$extractCount = 0

foreach ($db in $allVscdb) {
    # Check if locked
    try {
        $stream = [System.IO.File]::Open($db.FullName, 'Open', 'Read', 'None')
        $stream.Close()

        # Extract composer.composerData
        $composerData = sqlite3 $db.FullName "SELECT value FROM ItemTable WHERE key = 'composer.composerData';" 2>$null

        if ($composerData -and $composerData.Length -gt 10) {
            try {
                $parsed = $composerData | ConvertFrom-Json
                if ($parsed.allComposers -and $parsed.allComposers.Count -gt 0) {
                    $extractCount++
                    Write-Host "Found $($parsed.allComposers.Count) composers in: $($db.FullName -replace [regex]::Escape($env:USERPROFILE), '~')"

                    foreach ($comp in $parsed.allComposers) {
                        # Add source info
                        $comp | Add-Member -NotePropertyName "_sourceDb" -NotePropertyValue $db.FullName -Force
                        $allComposers += $comp
                    }
                }
            } catch {
                # JSON parse error, skip
            }
        }
    }
    catch {
        # Locked, skip
    }
}

Write-Host ""
Write-Host "=== EXTRACTION SUMMARY ===" -ForegroundColor Green
Write-Host "Databases with composers: $extractCount"
Write-Host "Total composers found: $($allComposers.Count)"

# Deduplicate by composerId
$uniqueComposers = $allComposers | Group-Object -Property composerId | ForEach-Object { $_.Group | Sort-Object lastUpdatedAt -Descending | Select-Object -First 1 }

Write-Host "Unique composers after dedup: $($uniqueComposers.Count)"

# Save to staging
$mergedData = @{
    allComposers = $uniqueComposers
    _mergedAt = (Get-Date).ToString("o")
    _sourceCount = $extractCount
}

$mergedData | ConvertTo-Json -Depth 10 | Out-File "$stagingDir\merged_composers.json" -Encoding UTF8
Write-Host ""
Write-Host "Saved to: $stagingDir\merged_composers.json"", "is_background": false, "explanation": "Extract and merge all composer data from workspace databases"}

