{"command": "$folder = "C:\Users\user\Downloads\CursorErrorEvidence_20251229_221343"

Write-Host "=== REQUEST IDs WITH VPN/ISP/INTERNET CONTEXT (from databases) ==="
Write-Host ""

$vpnRelatedIds = @{}

Get-ChildItem "$folder\databases\*.vscdb" | ForEach-Object {
    $bytes = [System.IO.File]::ReadAllBytes($_.FullName)
    $content = [System.Text.Encoding]::UTF8.GetString($bytes)

    # Find Request IDs near VPN/internet mentions (within 500 chars)
    $matches = [regex]::Matches($content, '(internet connection or VPN|check your internet|VPN).{0,300}Request\s*ID[:\s]+([a-f0-9]{8}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{12})', 'IgnoreCase,Singleline')
    foreach ($m in $matches) {
        $id = $m.Groups[2].Value
        if (-not $vpnRelatedIds.ContainsKey($id)) {
            $vpnRelatedIds[$id] = 0
        }
        $vpnRelatedIds[$id]++
    }

    # Also check reverse order
    $matches2 = [regex]::Matches($content, 'Request\s*ID[:\s]+([a-f0-9]{8}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{4}-[a-f0-9]{12}).{0,300}(internet connection or VPN|check your internet|VPN)', 'IgnoreCase,Singleline')
    foreach ($m in $matches2) {
        $id = $m.Groups[1].Value
        if (-not $vpnRelatedIds.ContainsKey($id)) {
            $vpnRelatedIds[$id] = 0
        }
        $vpnRelatedIds[$id]++
    }
}

Write-Host "Request IDs specifically associated with 'check internet/VPN' warnings:"
Write-Host ""
$vpnRelatedIds.GetEnumerator() | Sort-Object Value -Descending | ForEach-Object {
    Write-Host "$($_.Key): $($_.Value) occurrences with VPN/ISP context"
}

Write-Host ""
Write-Host "TOTAL Request IDs with VPN/ISP context: $($vpnRelatedIds.Count)"", "is_background": false, "explanation": "Find Request IDs with VPN/ISP context in databases"}

